import makeStyles from "@material-ui/core/styles/makeStyles"

const useStyles = makeStyles((theme) => ({  
    header :{
        width :"100%",
        background : "cyan",
        zIndex : "1",
        textAlign : "center",
        fontWeight : "800",
        fontSize : "25px",
        padding : "20px",
    },
    catbutton : {
        padding : "4px 20px",
        margin : "5px",
    }


}));

export default useStyles;
